    // displays the letters at the start of the game
    function displayLetters() {
        // gives weighted average
        function weighted_random(items, weights) {
            var j;
            var add = new Array(weights.length);
            for (k = 0; k < weights.length; k++)
                add[k] = weights[k]
            
            for (j = 1; j < add.length; j++)
                add[j] += add[j- 1];
            var random = Math.random() * add[weights.length - 1];
            console.log(random)
            for (j = 0; j < weights.length; j++)
                if (add[j] > random)
                    break;
            return items[j];
        }
    
        for (let i = 1; i < 7; i++){
            var id = 'l' + String(i)
            var randomChar = weighted_random(CHARARRAY, WEIGHTED)
            //var randomChar = CHARARRAY[Math.floor( Math.random() * CHARARRAY.length)]
            letters[i-1] = randomChar
            document.getElementById(id).innerHTML = randomChar
            lettertoindex[randomChar] = i
        }
    }
    
    
    // when you hit 'enter'
    function enter() {
        if (count > 2 && currentWord in WORDS && !(currentWord in words)){
            document.getElementById("s").innerHTML = "+" + (scores[count-1]);
            document.getElementById("s").style.backgroundColor= "#bcf5bc";
            currentScore += scores[count-1]
            document.getElementById("cs").innerHTML = String("Score: " + currentScore);
            currentWords.push({word: currentWord, score: scores[count]});
            words[currentWord] = 1;
            setTimeout(function(){
                document.getElementById("s").innerHTML = ''
                document.getElementById("s").style.backgroundColor =  'rgb(248, 240, 128)';
                ;
            }, 1000);
        }
        reset()
    }